import Navbar from '../Navbar';
import './About.css';

function About() {
  return (
    <div className='abouts'>
      <Navbar />
      <div className="about-container">
        <h1>About Us</h1>
        <p>
        This is Our project Travel-Planner app, and our team members are Sharayu Purnaik (J053) and Naman Upadhyaya (J066).
        </p>
        <p>Thank You!</p>
      </div>
    </div>
  );
}

export default About;
